$(function(){"use strict";$(".fadeIn").addClass("show");window.speakersSlide=new Swipe(document.getElementById("speakers"),{speed:1e3,auto:3e3,continuous:true,disableScroll:false,stopPropagation:false,transitionEnd:function(i,el){var _i=$(el).attr("data-slide-id");$("#speakers-thumbs span.pic").removeClass("active");$("#speakers-thumbs span.pic").eq(_i).addClass("active")}});$("#speakers-thumbs span.pic > img").click(function(e){e.preventDefault();var _i=$(this).attr("data-speaker-id");window.speakersSlide.slide(_i,1e3);$("#speakers-thumbs span.pic").removeClass("active");$("#speakers-thumbs span.pic").eq(_i).addClass("active");return false})});